import React from 'react';
import {connect} from "react-redux";

import classProvider from '../tools/classProvider';
import '../style/global.css';

const mapStateToProps = (state) => {
  return {
    appState: state.appState
  }
};

const About = (props) => {
  return(
    <div className={classProvider(props.appState.theme, 'about')}>
      <div className={classProvider(props.appState.theme, 'aboutContainer')}>
        <div> className={classProvider(props.appState.theme, 'aboutElements')}</div>
      </div>
    </div>
  );
};

export default connect(mapStateToProps)(About);
